-- NASAの星データ
drop table if exists nasa_star_data ;
create table nasa_star_data (
    hip_num                     INTEGER not null    -- HIP番号
  , right_ascension             REAL    not null    -- 赤径
  , declination                 REAL    not null    -- 赤緯
  , magnitude                   REAL    not null    -- 等級
  , constraint PK_nasa_star_data primary key ( hip_num )
);

delete from nasa_star_data ;


select count(*) from nasa_star_data ;
